function create_calender(a,o,r,e,t,n){var l=daysInMonth(o,r),s='<p class="cal_title">'+month_name(o)+" "+r+"</p>";for(i=0;i<l;i++){var d=i+1,c='<span class="cal_num">'+d+"</span><p>"+day_name(o,r,d)+"</p>";e.hasOwnProperty(d)?s+='<div class="cal_day is-highlighted">'+c+'<span class="tooltiptext"><p>'+t+"</p><p>"+e[d][0]+"</p><p>"+e[d][1]+"</p></span></div>":s+='<div class="cal_day">'+c+'<span class="tooltiptext">Nothing</span></div>'}$("#"+a).html(s),style_string="<style>",n.hasOwnProperty("mainColor")&&(style_string+="#"+a+" .cal_day:hover{color:"+n.mainColor+";}#"+a+" .cal_day.is-highlighted:hover{color:"+n.mainColor+";background: white;}#"+a+" .cal_day.is-highlighted{background-color:"+n.mainColor+";}#"+a+" .cal_day.is-highlighted .tooltiptext{background-color:"+n.mainColor+";}#"+a+" .cal_title{color:"+n.mainColor+";}"),n.hasOwnProperty("secondaryColor")&&(style_string+="#"+a+" .cal_day:hover{border:1px solid "+n.secondaryColor+";}#"+a+" .cal_day.is-highlighted:hover{border:1px solid "+n.secondaryColor+";}#"+a+" .cal_day{   background: "+n.secondaryColor+"; }#"+a+" .cal_day .tooltiptext{background-color:"+n.secondaryColor+";}"),style_string+="</style>",$("head").append(style_string)}function daysInMonth(a,o){return new Date(o,a,0).getDate()}function day_name(a,o,r){return{0:"Sunday",1:"Monday",2:"Tuesday",3:"Wednesday",4:"Thursday",5:"Friday",6:"Saturday"}[new Date(o,a-1,r).getDay()]}function month_name(a){return{1:"January",2:"February",3:"March",4:"April",5:"May",6:"June",7:"July",8:"August",9:"September",10:"October",11:"November",12:"December"}[a]}